            uint256 aDAIToDeduct = tradingFees.amountaDAIToDeduct(fees);
            wallet.updateBalance(tradingFees.aDAI(), order.user, aDAIToDeduct, false);
            //Credit Earned tokens
            wallet.updateBalance(
                order.tokenB,
                order.user,
