            //Credit Earned tokens after minusing fees
            wallet.updateBalance(
                order.tokenB,
                order.user,
                (_rate.mul(_amount)).div(decimals).sub(amountTokensToDeduct),
                true
            );
        }

        wallet.updateLockedFunds(order.user, order.tokenA, _amount, false);
        //seller update
