    //         order.waiveFees
    //     );
    // }

    function getFilledOrderLength(
        address _user,
        Side side
    ) public view returns (uint256) {
        return s_filledOrders[_user][uint256(side)].length;
    }

    // function getFilledOrder(
    //     address _user,
    //     Side side,
    //     uint256 index
    // )
    //     public
    //     view
    //     returns (
    //         uint256, //id
    //         uint256, //side
    //         address, //user
    //         address, //tokenA
    //         address, //tokenB
